let trials = rawdata.trials

let convertArrayOfObjectsToCSV = data => {  
    if(!data) return;
    let columnDelimiter = '\t'
    let lineDelimiter = '\n'
    let result, ctr,firstkey
    firstkey = Object.keys(trials)[0];
    let firstentry = trials[firstkey]
    let keys = Object.keys(firstentry)
    result = '';
    let df = ["rid"]
    keys.forEach(k => {
        if(Array.isArray(firstentry[k])){
            let arrayLength = firstentry[k].length;
            for(let i=0;i<arrayLength;i++){
                df.push(k+'_'+i)
            }
        }else{
            df.push(k)
        }
    })
     console.log(df)

    //build data frame


    result += df.join(columnDelimiter);
    result += lineDelimiter;

    let rowID = 1
    for (let key in trials) {
        let dataentry = trials[key]
        if(dataentry["expType"] == "main"){
            df.forEach(title =>{
                if(title.includes("_")){
                    let index = title.indexOf("_")
                    let titleKey = title.substring(0,index)
                    let titleIndex = title.substring(index+1,title.length)
                    result += columnDelimiter
                    result += dataentry[titleKey][titleIndex]
                }else if(title =='rid'){
                    result += rowID++;
                }
                else{
                    result += columnDelimiter
                    result += dataentry[title]
                }
               
            })
            result += lineDelimiter
        }
    }
     console.log(result)

  

    return result;
}

function downloadCSV() {  
        var data, filename, link;
        var tsv = convertArrayOfObjectsToCSV(trials)
        if (tsv == null) return;

        filename = 'export.tsv';

        if (!tsv.match(/^data:text\/csv/i)) {
            tsv = 'data:text/tsv;charset=utf-8,' + tsv;
        }
        data = encodeURI(tsv);

        link = document.createElement('a');
        link.setAttribute('href', data);
        link.setAttribute('download', filename);
        link.click();
    }
